
type Result = {
    id:number,
    name:string,
    latitude:number,
    longitude:number,
    metadata:
    {
        currentOffset:number,
        totalCount:number
    }   
}

type GlobalContent = {
    once: number,
    setOnce:any,
    data__:City[],
    SetData:any,
}


  interface CountAction {
    type: "UPDATE_CARDS";
    payload: number;
  }

  // An interface for our state
  interface CountState {
    count: number;
  }

type Results ={
    results:Result[]
}
type City = {
    id:number,
    latitude:number ,
    longitude:number,
    name:string
  }
enum WeatherOPT {
    Current  = "current",
    Forecast  = "forecast",
    Future  = "future",
}
type WheatherParams = {
    OnWhen:WeatherOPT,
    latitude:string ,
    longitude:string,
    days?:number,

}
type DataWheather = {
    location:{
        name:string,
        localtime:string
    },
    current:{
        temp_c:number
        temp_f:number
        condition:{
            text: string,
            icon:string,
            code: number
        },
        wind_mph: number,
        wind_kph:number,
        humidity:number,
        feelslike_c:number

    }
    forecast?:{
        forecastday:Day[]
    }

}

type Day = {
    date:string,
    day:{
        maxtemp_c: number,
        maxtemp_f: number,
        mintemp_c: number,
        mintemp_f: number,
        avgtemp_c: number,
        avgtemp_f: number,
        maxwind_mph: number,
        maxwind_kph: number,
        daily_will_it_rain: number,
        daily_chance_of_rain: number,
        daily_will_it_snow: number,
        daily_chance_of_snow: number,
        condition: {
         text: string,
         icon: string,
         code:number
     },
     hour:hours[]
    },
    
}



type hours = {
    time: string
    temp_c: number,
    temp_f: number,
    is_day: number,
    condition: {
        text: string,
        icon: string,
        code:number
    },
    "humidity": number,
    "will_it_rain": number,
    "chance_of_rain": number,
    "will_it_snow": number,
    "chance_of_snow": number
    "vis_km": number,
    "vis_miles": number,
}

